PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE goose_db_version (
		id INTEGER PRIMARY KEY AUTOINCREMENT,
		version_id INTEGER NOT NULL,
		is_applied INTEGER NOT NULL,
		tstamp TIMESTAMP DEFAULT (datetime('now'))
	);
CREATE TABLE blocks (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL,
    description TEXT,
    active BOOLEAN NOT NULL,
    env_variables TEXT,
    created_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc'))
);
CREATE TABLE programs (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL,
    created_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc'))
);
CREATE TABLE settings (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL,
    value TEXT
);
CREATE TABLE files (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    program_id INTEGER,
    created_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc')),
    filename TEXT,
    content TEXT,
    FOREIGN KEY (program_id) REFERENCES programs(id) ON DELETE CASCADE
);
CREATE TABLE periodic_tasks (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL,
    description TEXT,
    active BOOLEAN DEFAULT 1,
    env_variables TEXT,
    block_id INTEGER,
    program_id INTEGER,
    timezone TEXT DEFAULT 'UTC',
    cron TEXT NOT NULL,
    next_run_at DATETIME DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc')),
    created_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc')),
    updated_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc')),
    FOREIGN KEY(block_id) REFERENCES blocks(id) ON DELETE CASCADE,
    FOREIGN KEY (program_id) REFERENCES programs(id)
);
CREATE TABLE events (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    status TEXT NOT NULL,
    created_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc')),
    event_type TEXT NOT NULL,
    args TEXT, -- JSON string
    logs TEXT, -- JSON string
    webhook_id INTEGER,
    periodic_task_id INTEGER,
    block_id INTEGER NOT NULL,
    FOREIGN KEY (webhook_id) REFERENCES "webhooks_old"(id) ON DELETE CASCADE,
    FOREIGN KEY (periodic_task_id) REFERENCES periodic_tasks(id) ON DELETE CASCADE,
    FOREIGN KEY (block_id) REFERENCES blocks(id) ON DELETE CASCADE
);
CREATE TABLE users (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    username TEXT NOT NULL UNIQUE,
    password_hash TEXT NOT NULL,
    email TEXT NULL,
    settings JSON,
    role TEXT,
    created_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc')),
    updated_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc'))
);
CREATE TABLE credentials (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    type TEXT NOT NULL,
    name TEXT NOT NULL UNIQUE,
    oauth_url TEXT,
    oauth_token_url TEXT,
    grant_type TEXT NOT NULL,
    scope TEXT,
    value TEXT,
    client_id TEXT,
    client_secret TEXT,
    token TEXT,
    refresh_token TEXT,
    expiry TEXT,
    updated_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc'))
);
CREATE TABLE pages (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    path TEXT NOT NULL UNIQUE,
    name TEXT NOT NULL,
    description TEXT,
    active BOOLEAN DEFAULT 1,
    block_id INTEGER,
    canvas_state JSON,
    html_output TEXT,
    created_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc')),
    updated_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc')),
    FOREIGN KEY(block_id) REFERENCES blocks(id) ON DELETE CASCADE
);
CREATE TABLE webhooks (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT,
    description TEXT,
    active BOOLEAN DEFAULT 1,
    env_variables TEXT,
    response_headers TEXT,
    block_id INTEGER,
    path TEXT NOT NULL UNIQUE,
    cors TEXT,
    http_method TEXT DEFAULT 'GET',
    exit_http_pair TEXT,
    program_id INTEGER,
    created_at TIMESTAMP DEFAULT (strftime('%Y-%m-%d %H:%M:%f', 'now', 'utc')),
    FOREIGN KEY(block_id) REFERENCES blocks(id) ON DELETE CASCADE,
    FOREIGN KEY(program_id) REFERENCES programs(id)  -- Corrected here
);
DELETE FROM sqlite_sequence;
COMMIT;
